  \"2016-11-25T21:06:09.956708\",\n\t\"name\": \"edfacts-homeless-neglected-or-delinquent-201112\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Homeless, Neglected, or Delinquent,
  2011-12 (EDFacts HND:2011-12), is one of 17 'topics' identified in the EDFacts documentation
  (in this database, each 'topic' is entered as a separate study); program data is
  available since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts HND:2011-12 (ed.gov/about/inits/ed/edfacts/eden/non-xml/c175-8-0.doc)
  annually collects cross-sectional data from states about homeless students and students
  who are participating in programs for neglected or delinquent students (\"N or D\")
  under Title I, Part D of the Elementary and Secondary Education Act (ESEA), as amended.
  EDFacts HND:2011-12 data were collected using the EDFacts Submission System (ESS),
  a centralized portal and their submissions by states in mandatory and required for
  benefits. Not submitting the required reports by a state constitutes a failure to
  comply with law and may have consequences for federal funding to the states. Key
  statistics produced from EDFacts HND:2011-12 are from 5 data groups with information
  on Homeless Served (McKinney-Vento), Homeless Students Enrolled, N or D-Academic
  Achievement, N or D-Long Term Students Served, and N or D-Program Participation.
  For the purposes of this system, data groups are referred to as 'variables', as
  a result of the structure and format of EDFacts' data.\",\n\t\"license_title\":
